import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import { useAuth } from "../AuthProvider";
import { useCarrito } from "./CarritoContext";
import { ROLE } from './../constants/index';
import toastr from 'toastr';
import "../styles/NavBar.css";

const NavBar = () => {
  const [dropdownVisible, setDropdownVisible] = useState(false);
  const [submenuVisible, setSubmenuVisible] = useState("");
  const auth = useAuth();

  const handleMouseEnter = () => {
    setDropdownVisible(true);
  };

  const handleMouseLeave = () => {
    setDropdownVisible(false);
    setSubmenuVisible("");
  };

  const handleSubmenuEnter = (menu) => {
    setSubmenuVisible(menu);
  };

  const handleSubmenuLeave = () => {
    setSubmenuVisible("");
  };

  const { carrito } = useCarrito();
  const totalProductos = carrito.reduce((total, item) => total + item.cantidad, 0);
  const userRole = auth?.user ? auth?.user?.role : null;

  return (
    <div>
      <nav>
        <div className="navbar">
          <div className="logo">
            <NavLink to="/dashboard">
              <h1>JOYERIA D'LAURA</h1>
            </NavLink>
          </div>
          <div className="menu-items">
            <ul>
              {userRole === ROLE.ADMIN && (
                <li
                  onMouseEnter={handleMouseEnter}
                  onMouseLeave={handleMouseLeave}
                  className="dropdown"
                >
                  <li style={{cursor: "pointer"}}>Administrar</li>
                  {dropdownVisible && (
                    <ul className="dropdown-menu">
                      <li onMouseEnter={() => handleSubmenuEnter('Registrar')} onMouseLeave={handleSubmenuLeave} style={{cursor: "pointer"}}>
                        Registrar
                        {submenuVisible === 'Registrar' && (
                          <ul className="submenu">
                            <li><NavLink to="/register/material">Material</NavLink></li>
                            <li><NavLink to="/register/categoria">Categoría</NavLink></li>
                            <li><NavLink to="/register/producto">Producto</NavLink></li>
                          </ul>
                        )}
                      </li>
                      <li onMouseEnter={() => handleSubmenuEnter('Consultar')} onMouseLeave={handleSubmenuLeave} style={{cursor: "pointer"}}>
                        Consultar
                        {submenuVisible === 'Consultar' && (
                          <ul className="submenu">
                            <li><NavLink to="/list/productos">Productos</NavLink></li>
                            <li><NavLink to="/list/facturas">Facturas</NavLink></li>
                            <li><NavLink to="/list/clients">Clientes</NavLink></li>
                          </ul>
                        )}
                      </li>
                    </ul>
                  )}
                </li>
              )}
              <li>
                <NavLink to="/Categorias">Categorías</NavLink>
              </li>
              {userRole === ROLE.CLIENTE && (
                <li>
                  {totalProductos > 0 ? (
                    <NavLink to="/carrito">Carrito ({totalProductos})</NavLink>
                  ) : (
                    <NavLink to="/carrito">Carrito</NavLink>
                  )}
                </li>
              )}
              <li>
                <NavLink to="/About">Acerca De</NavLink>
              </li>
              <li>
                {auth.user ? (
                  <button onClick={() => {
                    auth.logOut();
                  }}>Salir</button>
                ) : (
                  <NavLink to="/login">Ingresar</NavLink>
                )}
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </div>
  );
};
export default NavBar;
